export interface TestPhoneData {
  [phone: string]: string; 
}

export interface UserData {
  id: string;
  phone: string;
  password: string;
  isRegistered: boolean;
  firstName?: string;  
  lastName?: string;   
  email?: string;
}

export interface TestDB {
  codes: TestPhoneData;
  users: { [phone: string]: UserData };
  lastRequestTime: { [phone: string]: number };
